@Component({
  selector: 'app-servizi',
  templateUrl: './servizi.component.html',
  styleUrls: ['./servizi.component.css']
})
export class ServiziComponent {

}
<div class="contattaci" style=" position: absolute;
background-color: #0072b1;
left: 0;
right: 0;
bottom: 0;
top: 0;
margin: auto;">
  <ul style="font-weight: 700;font-size: 25px;">Contatti</ul>
  <ul style="width: 500px;display: flex;">Telefono: <h3
    style="margin-left: 10px; margin-bottom: 10px; margin-top: -3px;">+39 342 776 5920</h3></ul>
  <ul style="display: flex;">Mail: <h3 style="margin-left: 10px; margin-bottom: 10px; margin-top: -3px;">
    vaccarofabrizio11@gmail.com</h3></ul>

  <br><br><br><br>


  <h3 style="margin-left: 46px;">Segnalazione</h3>
  <textarea formControlName="text" style="margin-left: 46px; font-size: 15px;" name="" id="" cols="30" rows="5"
